
def subarraysDivByK(nums, k):
    remainder_count = {0: 1}
    # Initialize the current sum and the result
    current_sum = 0
    result = 0
    for num in nums:
        current_sum += num
        # Find the remainder of the current sum when divided by k
        remainder = current_sum % k
        # If remainder is negative, make it positive
        if remainder < 0:
            remainder += k
        # If the remainder has occurred before, update the result
        if remainder in remainder_count:
            result += remainder_count[remainder]
        # Update the remainder count in the dictionary
        if remainder not in remainder_count:
            remainder_count[remainder] = 1
        else:
            remainder_count[remainder] += 1
    return result


